import React from 'react';
import {Link} from "react-router-dom"

const Subheader = () => {
    return (
        <div className='bg-[#F3F3F3] pl-28 pr-28 h-[60px] flex items-center justify-start'>
            <div className='text-[#868686]'>
                <Link to={"/products"}  className='m-3 cursor-pointer'>New In</Link>
                <Link to={"/products"} className='m-3 cursor-pointer'>Football</Link>
                <Link to={"/products"} className='m-3 cursor-pointer'>Basketball</Link>
                <Link to={"/products"} className='m-3 cursor-pointer'>Badminton</Link>
                <Link to={"/products"} className='m-3 cursor-pointer'>Rugby</Link>
                <Link to={"/products"} className='m-3 cursor-pointer'>Tennis</Link>
                <Link to={"/products"} className='m-3 cursor-pointer'>Hockey</Link>
                <Link to={"/products"} className='m-3 cursor-pointer'>Lifestyle</Link>
                <Link to={"/products"} className='m-3 cursor-pointer'>American Football</Link>
                <Link to={"/products"} className='m-3 cursor-pointer'>Sales</Link>
            </div>
        </div>
    );
};

export default Subheader;
